import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

import Link from '@material-ui/core/Link';
import Title from '../common/Title';


// Generate Order Data
function createData(element, level, explain) {
       return { element, level, explain };
}

const frontLangRows = [
       createData("HTML", 3, "独学で実装することができる"),
];
const fronLibRows = [
       createData("HTML", 3, "独学で実装することができる"),
];

const backLangRows = [
       createData("HTML", 3, "独学で実装することができる"),
];

const backFwRows = [
       createData("HTML", 3, "独学で実装することができる"),
];

const backOsRows = [
       createData("HTML", 3, "独学で実装することができる"),
];


const toolRows = [
       createData("HTML", 3, "独学で実装することができる"),
];

const otherRows = [
       createData("HTML", 3, "独学で実装することができる"),
];

const useStyles = makeStyles((theme) => ({
       seeMore: {
              marginTop: theme.spacing(3),
       },
       paper: {
              padding: theme.spacing(2),
              display: 'flex',
              overflow: 'auto',
              flexDirection: 'column',
       },
}));

function preventDefault(event) {
       event.preventDefault();
}

export default function Skills() {
       const classes = useStyles();
       return (
              <>
                     <Title>フロントエンド</Title>
                     <Table size="small">
                            <TableHead>
                                   <TableRow>
                                          <TableCell>技術要素</TableCell>
                                          <TableCell>レベル</TableCell>
                                          <TableCell>説明</TableCell>
                                          {/* <TableCell align="right">Sa？le Amount</TableCell> */}
                                   </TableRow>
                            </TableHead>
                            <TableBody>
                                   {frontLangRows.map((row) => (
                                          <TableRow key={row.element}>
                                                 <TableCell>{row.element}</TableCell>
                                                 <TableCell>{row.level}</TableCell>
                                                 <TableCell>{row.explain}</TableCell>
                                                 <TableCell>{row.paymentMethod}</TableCell>
                                                 <TableCell align="right">{row.amount}</TableCell>
                                          </TableRow>
                                   ))}
                            </TableBody>
                     </Table>
                     <div className={classes.seeMore}>
                            <Link color="primary" href="#" onClick={preventDefault}>
                                   See more orders
                            </Link>
                     </div>
              </>
       )
}
